;; **
;;; What is the influence of the hyperparameters @@m@@, @@w@@, @@y@@ and the number of samples on the final fit? Try to put some priors on those as well. You may also find it interesting to plot the obtained samples - you can vary the line width according to the log-weight of the sample.
;; **

;; @@
(apply
  plot/compose
  ;; Plot points
  (plot/list-plot 
    (map vector xs ys) 
    :color "#000000"
    :symbol-size 15)
  ;; Plot actual function - green
  (plot/plot 
    #(* 0.01 (f %))
    [-10 10]
    :color "#00FF00")
  ;; Plot fit - red
  (plot/plot 
    #(curve w-exp %) 
    [-10 10]
    :color "#FF0000")
  (map 
    (fn [s] 
      (plot/plot 
        #(curve (:w (:result s)) %) 
        [-10 10] 
        :plot-range [[-10 10] [-50 50]]
        :color "#0000FF10"))
    (take-nth 100 samples)))
